create table currency
(
    id                 int auto_increment
        primary key,
    name               varchar(255) null,
    symbol             varchar(255) null,
    `rank`             int          null,
    main_link          text         null,
    historical_link    text         null,
    circulating_supply double       null
);



create table github
(
    id                 int auto_increment
        primary key,
    currency_id        int  null,
    commits_count      int  null,
    contributors_count int  null,
    forks_count        int  null,
    stars_count        int  null,
    github_link        text null,
    constraint id
        unique (id),
    constraint complete_github_data_currency_data_id_fk
        foreign key (currency_id) references currency (id)
);



create table languages
(
    id   int          not null
        primary key,
    name varchar(255) null
);



create table languages_currency
(
    id          int auto_increment
        primary key,
    currency_id int    null,
    language_id int    null,
    percentage  double null,
    constraint id
        unique (id),
    constraint currency_lang_data_currency_data_id_fk
        foreign key (currency_id) references currency (id),
    constraint currency_lang_data_languages_id_fk
        foreign key (language_id) references languages (id)
);



create table tags
(
    id   int          not null
        primary key,
    name varchar(255) null
);



create table tags_currency
(
    id          int auto_increment
        primary key,
    currency_id int null,
    tag_id      int null,
    constraint id
        unique (id),
    constraint currency_tag_data_currency_data_id_fk
        foreign key (currency_id) references currency (id),
    constraint currency_tag_data_tags_id_fk
        foreign key (tag_id) references tags (id)
);

